// Name: TurboHook
// ID: cubesterTurboHook
// Description: Allows you to use webhooks.
// By: CubesterYT <https://scratch.mit.edu/users/CubesterYT/>

(function (Scratch) {
  "use strict";

  const icon =
    "data:image/png;base64,";

  const parseOrEmptyObject = (str) => {
    try {
      const obj = JSON.parse(str);
      if (obj && typeof obj === "object") return obj;
    } catch (e) {
      return {};
    }
  };

  class TurboHook {
    getInfo() {
      return {
        id: "cubesterTurboHook",
        name: "TurboHook",
        color1: "#3c48c2",
        color2: "#2f39a1",
        color3: "#28318f",
        menuIconURI: icon,
        docsURI: "https://extensions.turbowarp.org/CubesterYT/TurboHook",

        blocks: [
          {
            opcode: "webhook",
            text: "webhook data: [hookDATA] webhook url: [hookURL]",
            blockType: Scratch.BlockType.COMMAND,
            arguments: {
              hookURL: {
                type: Scratch.ArgumentType.STRING,
              },
            },
          },
          {
            opcode: "params",
            blockType: Scratch.BlockType.REPORTER,
            text: "[MENU] [DATA]",
            arguments: {
              MENU: {
                type: Scratch.ArgumentType.STRING,
                menu: "PARAMS",
              },
              DATA: {
                type: Scratch.ArgumentType.STRING,
              },
            },
          },
          {
            opcode: "connector",
            blockType: Scratch.BlockType.REPORTER,
            text: "[STRING1] , [STRING2]",
          },
        ],
        menus: {
          PARAMS: {
            acceptReporters: true,
            items: ["content", "name", "icon"],
          },
        },
      };
    }

    webhook({ hookDATA, hookURL }) {
      const data = parseOrEmptyObject(hookDATA);
      if (!data.content) {
        // Typically this can't be empty, so put something there if they forgot to
        data.content = "(empty)";
      }
      Scratch.fetch(hookURL, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(data),
      });
    }
    params({ MENU, DATA }) {
      DATA = Scratch.Cast.toString(DATA);
      if (MENU == "content") {
        return JSON.stringify({ content: DATA });
      } else if (MENU == "name") {
        return JSON.stringify({ username: DATA });
      } else if (MENU == "icon") {
        return JSON.stringify({ avatar_url: DATA });
      }
      return "{}";
    }
    connector({ STRING1, STRING2 }) {
      return JSON.stringify({
        ...parseOrEmptyObject(STRING1),
        ...parseOrEmptyObject(STRING2),
      });
    }
  }

  Scratch.extensions.register(new TurboHook());
})(Scratch);
